"     </div>",
"    </div>",
"   </div>",
"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Cytomegalovirus (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/cytomegalovirus-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H8432697\">",
"      <span class=\"h1\">",
"       What is cytomegalovirus (CMV)?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Cytomegalovirus is a virus that can cause a fever, tiredness, and other symptoms. Doctors also call it &ldquo;CMV.&rdquo;",
"     </p>",
"     <p>",
"      CMV is very common. Many people have the virus without knowing it. Some people don&rsquo;t get sick when they have it, but others do.",
"     </p>",
"     <p>",
"      CMV can cause serious illness in people with conditions that weaken the body&rsquo;s infection-fighting system (called the &ldquo;immune system&rdquo;). These conditions include:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An organ transplant, such as a new kidney or lung",
"       </li>",
"       <li>",
"        A bone marrow transplant",
"       </li>",
"       <li>",
"        HIV &ndash; This is the virus that causes AIDS.",
"       </li>",
"       <li>",
"        Being in the hospital for a long time, especially in the intensive care unit (also called the &ldquo;ICU&rdquo;).",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      CMV can be very serious for people with these conditions. It can even be life-threatening. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8432712\">",
"      <span class=\"h1\">",
"       What are the symptoms of CMV?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Many people who have the virus do not have symptoms. If symptoms happen, they are usually mild in people with healthy immune systems. People with weak immune systems can have more severe symptoms.",
"     </p>",
"     <p>",
"      The most common symptom of CMV is an illness called &ldquo;mononucleosis&rdquo; or &ldquo;mono.&rdquo; But CMV is not always the cause of mono. A doctor or nurse can tell if CMV is the cause.",
"     </p>",
"     <p>",
"      Common symptoms of mono from CMV include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Tiredness",
"       </li>",
"       <li>",
"        Body aches",
"       </li>",
"       <li>",
"        Sore throat",
"       </li>",
"       <li>",
"        Swollen glands in the neck &ndash; This is more common in children than adults.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Less common CMV symptoms can happen in specific parts of the body. These symptoms are more likely to happen in people with weak immune systems. They can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Digestive system problems, such as bloody diarrhea and belly pain",
"       </li>",
"       <li>",
"        Lung problems, such as trouble breathing and dry cough",
"       </li>",
"       <li>",
"        Problems with the liver, eyes, nervous system, or heart",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8432727\">",
"      <span class=\"h1\">",
"       Will I need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. There are several tests, but you probably will not need all of them. Tests can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Blood tests",
"       </li>",
"       <li>",
"        Urine tests",
"       </li>",
"       <li>",
"        Tests on a sample of fluid from your lungs, throat, or other part of the body",
"       </li>",
"       <li>",
"        Tests on a sample of tissue from an affected body part",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8432744\">",
"      <span class=\"h1\">",
"       How is CMV treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;People with healthy immune systems who get sick with CMV do not usually need treatment. They usually feel better in a few days or weeks. Medicines like",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?19/35/20021?source=see_link\">",
"       acetaminophen",
"      </a>",
"      &nbsp;(sample brand name: Tylenol&reg;) or",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?14/17/14614?source=see_link\">",
"       ibuprofen",
"      </a>",
"      &nbsp;(sample brand names: Advil&reg;, Motrin&reg;) can relieve mild symptoms of CMV. If you take these medicines, be sure to follow the directions on the label.",
"     </p>",
"     <p>",
"      Doctors can treat severe CMV symptoms with medicines, such as",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?37/48/38656?source=see_link\">",
"       ganciclovir",
"      </a>",
"      (brand name: Cytovene&reg;-IV). Ganciclovir is given through a thin tube called an &ldquo;IV.&rdquo; The tube goes into a vein. Ganciclovir is usually given to people with CMV who have weak immune systems.",
"     </p>",
"     <p>",
"      When a person gets an organ transplant, doctors might give a pill, such as",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?19/29/19925?source=see_link\">",
"       valganciclovir",
"      </a>",
"      (brand name: Valcyte&reg;), to help prevent CMV. Some people with severe CMV symptoms get this medicine instead of",
"      <a class=\"drug drug_patient\" href=\"UTD.htm?37/48/38656?source=see_link\">",
"       ganciclovir",
"      </a>",
"      , even if they have not had an organ transplant. &nbsp;",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8432759\">",
"      <span class=\"h1\">",
"       What if I am pregnant?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Tell your doctor or nurse if you have a fever, sore throat, and body aches. He or she might do a blood test to check for CMV. You might also have the test if you have a condition that weakens your immune system. This is because you can give the CMV infection to your unborn baby.",
"     </p>",
"     <p>",
"      CMV can cause serious health problems in some newborn babies, so it is important to know if you have it. That way, doctors can look for problems in the baby and treat them if they happen. Problems can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Hearing loss",
"       </li>",
"       <li>",
"        Seizures",
"       </li>",
"       <li>",
"        Eye problems",
"       </li>",
"       <li>",
"        Problems with learning and growing",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      Most people don&rsquo;t know if they have CMV or not. But if you are pregnant or trying to get pregnant, it&rsquo;s a good idea to do things that reduce your chances of getting it, just in case. You can:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Avoid kissing toddlers and children on the mouth.",
"       </li>",
"       <li>",
"        Avoid sharing eating or drinking utensils, drinks, or food with toddlers or young children.",
"       </li>",
"       <li>",
"        Wash your hands well after changing diapers or wiping a child&rsquo;s nose or face.",
"       </li>",
"       <li>",
"        Avoid having sex if your partner is sick with a CMV infection. CMV can be spread by sex.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H8432774\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
